<!doctype html>
<html lang="en">
<head>
<meta charset="utf-8">
<title>Flatland SVG Animation</title>

<body>
<style>
/* define base colors: background, color, background_1, color_1 */

* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

:root {
  --background: #f0f0f0;
  --color: #333333;
  --background_1: #e0f7e9;
  --color_1: #222222;
  --light_control_primary: #c7c7c7;
  --light_control_secondary: #6c6c6c;
}

html, body {
  height: 100%;
}

body {
  font-family: system-ui, -apple-system, sans-serif;
  background-color: var(--background);
}

.header, .footer {
  background: var(--color);
  color: var(--background);
}

.header {
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  height: 46px;
}
h2 {
  text-align: center;
  margin-block: 8px 10px;
}

.footer {
  position: fixed;
  bottom: 0;
  left: 0;
  right: 0;
  height: 60px;
  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: row;
}

.footer-svg-foreground {
  fill: var(--background);
}

.settings_panel {
  position: fixed;
  top: 42px;
  left: 10px;
  padding: 10px;
  font-size: 9px;
  display: flex;
  flex-direction: column;
}

.settings_widget {
  padding: 6px;
  margin: 6px;
  font-family: monospace;
  border-radius: 6px;
  background-color: var(--color);
  color: var(--background);
}

.content {
  position: absolute;
  top: 46px;      /* same as header height */
  bottom: 60px;   /* same as footer height */
  left: 0;
  right: 0;

  display: flex;
}

.svg_container {
  flex: 1;
  overflow: hidden; /* or auto if needed */
}

.svg_canvas {
  width: 100%;
  height: 100%;
}

.train_info {
  padding: 10px;
  font-size: 9px;
  display: flex;
  flex-direction: column;
  gap: 8px;

  overflow-y: auto; /* enables scrolling */
}

.train_info_entry {
  color: black;
  min-width: 170px;
  padding: 6px;
  margin: 6px;
  border-radius: 6px;
  font-family: monospace;
  text-align: center;
  opacity: 0.85;
}

.train_info_entry:hover {
  opacity: 1;
  transition: 0.2s;
}

.train_info_header {
  font-size: 12px;
  font-weight: bold;
}

.train_0_background { background-color: #d50000; }
.train_1_background { background-color: #2979ff; }
.train_2_background { background-color: #ff6f00; }


.background{fill:var(--background)}
.no-fill{fill:none;}
.railroad-tie{fill:#978679;}
.railroad{fill:#3D3D3D;}
.train-outline{fill:#cdcdcd;}
.train-window{fill:#444444;}
.train-roof{fill:#5b5a5a;}
.train-headlights{fill:#fbfbfb;}
.train-fill-0{fill: #d50000;}
.train-fill-1{fill: #2979ff;}
.train-fill-2{fill: #ff6f00;}

.tree-1{fill:#8B5420;}
.tree-2{fill:#A8642A;}
.tree-3{fill:#80983C;}
.tree-4{fill:#84A83E;}
.tree-5{fill:#5DAD61;}
.tree-6{fill:#418050;}
.train:hover .train_background {
  stroke-opacity:1;
  transition: 0.2s;
}
.train_rotation {
  transform-box: fill-box;
}
.train_signal {
  opacity: 0;
}
.green_light, .red_light {
  opacity: 0.2;
}
.train_signal.red, .train_signal.green {
  opacity: 1;
}
.train_signal.red .red_light {
  opacity: 1;
}
.train_signal.green .green_light {
  opacity: 1;
}


body:has(#train_0_info:hover) #train_0_path {
  stroke-width: 2.6666666666666665px;
  opacity: 1.0;
  transition: 0.2s;
}

body:has(#train_0_main:hover) #train_0_info {
  opacity: 1.0;
  transition: 0.2s;
}

svg:has(#train_0_main:hover) #train_0_path {
   stroke-width: 2.6666666666666665px;
   opacity: 1.0;
   transition: 0.2s;
 }

 body:has(#train_0_info:hover) #train_0_background {
  stroke-opacity: 1.0;
  transition: 0.2s;
}

body:has(#train_1_info:hover) #train_1_path {
  stroke-width: 2.6666666666666665px;
  opacity: 1.0;
  transition: 0.2s;
}

body:has(#train_1_main:hover) #train_1_info {
  opacity: 1.0;
  transition: 0.2s;
}

svg:has(#train_1_main:hover) #train_1_path {
   stroke-width: 2.6666666666666665px;
   opacity: 1.0;
   transition: 0.2s;
 }

 body:has(#train_1_info:hover) #train_1_background {
  stroke-opacity: 1.0;
  transition: 0.2s;
}

body:has(#train_2_info:hover) #train_2_path {
  stroke-width: 2.6666666666666665px;
  opacity: 1.0;
  transition: 0.2s;
}

body:has(#train_2_main:hover) #train_2_info {
  opacity: 1.0;
  transition: 0.2s;
}

svg:has(#train_2_main:hover) #train_2_path {
   stroke-width: 2.6666666666666665px;
   opacity: 1.0;
   transition: 0.2s;
 }

 body:has(#train_2_info:hover) #train_2_background {
  stroke-opacity: 1.0;
  transition: 0.2s;
}



.cell:hover text {
    opacity: 1.0;
    transition: 0.2s;
}
.cell:hover rect, .row_label:hover rect, .col_label:hover rect {
    fill-opacity: 0.3;
    transition: 0.2s;
}

.slider-path {
  stroke: var(--light_control_secondary);
}

.slider-handle {
  cursor: pointer;
  fill: var(--background);
  stroke: var(--light_control_primary);
}


.button rect {
  fill: var(--light_control_secondary);
  fill-opacity: 0.9;
  stroke: var(--light_control_primary);
  stroke-width: 1;
  stroke-opacity: 0;
  cursor: pointer;
}

.button rect {
  fill: var(--light_control_secondary);
  fill-opacity: 0.9;
  stroke: var(--light_control_primary);
  stroke-width: 1;
  stroke-opacity: 0;
  cursor: pointer;
}

.fill-button path {
  fill: var(--background);
  fill-opacity: 0.8;
  cursor: pointer;
}

.stroke-button path {
  stroke: var(--background);
  stroke-opacity: 0.8;
  fill: none;
  cursor: pointer;
}

.button:hover rect {
  stroke-opacity: .3;
  fill-opacity: .15;
  transition: .2s;
}

.active rect, .button:active rect {
  stroke-opacity: .9;
  fill-opacity: 0.1;
  transition: .2s;
}
.active path, .button:active path {
  fill-opacity: .9;
  stroke-opacity: .9;
  transition: .2s;
}

</style>

var panZoomTiger = svgPanZoom('#svg_canvas', {
  zoomEnabled: true,
  zoomScaleSensitivity: 0.1,
  minZoom: 0.5,
  maxZoom: 25,
  controlIconsEnabled: true,
  fit: true,
  center: true,
});

/* =======================
   SETUP
   ======================= */
const train_0_rotation = document.getElementById('train_0_rotation_group');
const train_0_animate = document.getElementById('train_0_animate');
const train_0_opacity_animation = document.getElementById('train_0_opacity_animation');
const train_0_status = document.getElementById('train_0_status');
const train_0_action = document.getElementById('train_0_action');
const train_0_pos = document.getElementById('train_0_pos');
const train_1_rotation = document.getElementById('train_1_rotation_group');
const train_1_animate = document.getElementById('train_1_animate');
const train_1_opacity_animation = document.getElementById('train_1_opacity_animation');
const train_1_status = document.getElementById('train_1_status');
const train_1_action = document.getElementById('train_1_action');
const train_1_pos = document.getElementById('train_1_pos');
const train_2_rotation = document.getElementById('train_2_rotation_group');
const train_2_animate = document.getElementById('train_2_animate');
const train_2_opacity_animation = document.getElementById('train_2_opacity_animation');
const train_2_status = document.getElementById('train_2_status');
const train_2_action = document.getElementById('train_2_action');
const train_2_pos = document.getElementById('train_2_pos');

const stepLabel = document.getElementById("step_label");

const playButton = document.getElementById("play_button");
const pauseButton = document.getElementById("pause_button");
const firstButton = document.getElementById("first_button");
const lastButton = document.getElementById("last_button");
const backwardButton = document.getElementById("backward_button");
const forwardButton = document.getElementById("forward_button");

const sliderHandle = document.getElementById("slider_handle");
const sliderBackground = document.getElementById("slider_background");
const sliderRect = sliderBackground.getBoundingClientRect();
const sliderWidth = sliderRect.width;
const sliderOffset = 30.0;
let ms_per_step = 194;

const msPerStepInput = document.getElementById("ms_per_step_input");
msPerStepInput.onchange = e => {
  const value = parseInt(msPerStepInput.value);
  if (!isNaN(value) && value >= 10 && value <= 10000) {
    ms_per_step = value;
  }
  if (playing) {
    pause();
    play();
  }
  console.log(`ms_per_step set to ${ms_per_step}`);
};

// Extract and sort steps
const path_0 = data["0"];
const path_1 = data["1"];
const path_2 = data["2"];

const MAX_STEP = 154;
const steps = Array.from({length: MAX_STEP + 1}, (_, i) => i);

/* =======================
   RENDERING
   ======================= */
let currentStep = 0;
let playing = false;
let timer = null;

function renderStep(step) {
  stepLabel.textContent = `Time Step: ${step}`;
  const state_0 = path_0[step];
  train_0_animate.setAttribute('dur', `${ms_per_step}ms`);
  train_0_animate.setAttribute('keyPoints', `${state_0.keyPoints}`);
  train_0_animate.setAttribute('path', `${state_0.motionPath}`);
  train_0_animate.beginElement();
  train_0_opacity_animation.setAttribute('dur', `${ms_per_step}ms`);
  train_0_opacity_animation.setAttribute('from', state_0.opacity[0]);
  train_0_opacity_animation.setAttribute('to', state_0.opacity[1]);
  train_0_status.textContent = `Status: ${state_0.status}`;
  train_0_action.textContent = ` Action: ${state_0.action}`;
  train_0_pos.textContent = ` Position: [${state_0.position}]`;
  train_0_signal_group.classList.remove('hide', 'red', 'green');
  if (state_0.signal === 'red') {
    train_0_signal_group.classList.add('red');
  } else if (state_0.signal === 'green') {
    train_0_signal_group.classList.add('green');
  } else {
    train_0_signal_group.classList.add('hide');
  }
  const state_1 = path_1[step];
  train_1_animate.setAttribute('dur', `${ms_per_step}ms`);
  train_1_animate.setAttribute('keyPoints', `${state_1.keyPoints}`);
  train_1_animate.setAttribute('path', `${state_1.motionPath}`);
  train_1_animate.beginElement();
  train_1_opacity_animation.setAttribute('dur', `${ms_per_step}ms`);
  train_1_opacity_animation.setAttribute('from', state_1.opacity[0]);
  train_1_opacity_animation.setAttribute('to', state_1.opacity[1]);
  train_1_status.textContent = `Status: ${state_1.status}`;
  train_1_action.textContent = ` Action: ${state_1.action}`;
  train_1_pos.textContent = ` Position: [${state_1.position}]`;
  train_1_signal_group.classList.remove('hide', 'red', 'green');
  if (state_1.signal === 'red') {
    train_1_signal_group.classList.add('red');
  } else if (state_1.signal === 'green') {
    train_1_signal_group.classList.add('green');
  } else {
    train_1_signal_group.classList.add('hide');
  }
  const state_2 = path_2[step];
  train_2_animate.setAttribute('dur', `${ms_per_step}ms`);
  train_2_animate.setAttribute('keyPoints', `${state_2.keyPoints}`);
  train_2_animate.setAttribute('path', `${state_2.motionPath}`);
  train_2_animate.beginElement();
  train_2_opacity_animation.setAttribute('dur', `${ms_per_step}ms`);
  train_2_opacity_animation.setAttribute('from', state_2.opacity[0]);
  train_2_opacity_animation.setAttribute('to', state_2.opacity[1]);
  train_2_status.textContent = `Status: ${state_2.status}`;
  train_2_action.textContent = ` Action: ${state_2.action}`;
  train_2_pos.textContent = ` Position: [${state_2.position}]`;
  train_2_signal_group.classList.remove('hide', 'red', 'green');
  if (state_2.signal === 'red') {
    train_2_signal_group.classList.add('red');
  } else if (state_2.signal === 'green') {
    train_2_signal_group.classList.add('green');
  } else {
    train_2_signal_group.classList.add('hide');
  }

  const percent = step / MAX_STEP;
  const handleX = sliderRect.left + percent * sliderRect.width;
  // console.log(`step: ${step}, max: ${MAX_STEP}, percent: ${percent}, handleX: ${handleX}, slider width: ${sliderRect.width}`);
  sliderHandle.setAttribute("cx", sliderOffset + handleX - sliderRect.left);
}

/* =======================
   PLAY / PAUSE LOGIC
   ======================= */
function play() {
  if (playing) return;
  playing = true;

  playButton.classList.add("active");
  pauseButton.classList.remove("active");

  timer = setInterval(() => {
    renderStep(currentStep);
    currentStep++;

    if (currentStep > MAX_STEP) {
      pause();
    }
  }, ms_per_step);
}

function pause() {
  playing = false;
  playButton.classList.remove("active");
  pauseButton.classList.add("active");
  clearInterval(timer);
}

function reset() {
  pause();
  currentStep = 0;
  renderStep(0);
}

function goToLast() {
  pause();
  currentStep = MAX_STEP;
  renderStep(MAX_STEP);
}

function goBackward() {
  pause();
  currentStep = Math.max(0, currentStep - 1);
  renderStep(currentStep);
  train_0_animate.endElement();
  train_1_animate.endElement();
  train_2_animate.endElement();

}
function goForward() {
  pause();
  currentStep = Math.min(MAX_STEP, currentStep + 1);
  renderStep(currentStep);
}

/* =======================
   EVENTS
   ======================= */

playButton.onclick = () => {
  play();
};
pauseButton.onclick = () => {
  pause();
};

firstButton.onclick = reset;
lastButton.onclick = goToLast;
backwardButton.onclick = goBackward;
forwardButton.onclick = goForward;

// if left arrow or right arrow is pressed, move slider
document.onkeydown = e => {
  if (e.key === "ArrowLeft") {
    goBackward();
  } else if (e.key === "ArrowRight") {
    goForward();
  } else if (e.key === " ") {
    if (playing) {
      pause();
    } else {
      play();
    }
    e.preventDefault();
  }
};

sliderHandle.onmousedown = e => {
  pause();
  e.preventDefault();
  const onMouseMove = e => {
    let x = e.clientX;
    if (x < sliderRect.left) x = sliderRect.left;
    if (x > sliderRect.right) x = sliderRect.right;
    const percent = (x - sliderRect.left) / sliderRect.width;
    const step = Math.round(percent * MAX_STEP);
    currentStep = step;
    renderStep(currentStep);
  };
  const onMouseUp = e => {
    document.removeEventListener("mousemove", onMouseMove);
    document.removeEventListener("mouseup", onMouseUp);
  };
  document.addEventListener("mousemove", onMouseMove);
  document.addEventListener("mouseup", onMouseUp);
};


/* =======================
   INIT
   ======================= */
renderStep(0);
</script>

</body>
</html>
